
SET SQL_MODE = "NO_AUTO_VALUE_ON_ZERO";
SET time_zone = "+00:00";


CREATE TABLE `administrators` (
  `id` int(10)  UNSIGNED NOT NULL AUTO_INCREMENT PRIMARY KEY,
  `username` varchar(20) DEFAULT NULL,
  `password` varchar(20) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



CREATE TABLE `diabdata` (
  `unique_id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT PRIMARY KEY,
  `session_id` varchar(50) NOT NULL,
  `region` varchar(30) DEFAULT NULL,
  `gender` enum('M','F') DEFAULT NULL,
  `age` enum('<45','45-54','55-64','>64') DEFAULT NULL,
  `weight` int(3) DEFAULT NULL,
  `height` decimal(4,2) DEFAULT NULL,
  `bmi` decimal(4,2) DEFAULT NULL,
  `waist` enum('<94cm','94-102cm','>102cm','<80cm','80-88cm','>88cm') DEFAULT NULL,
  `activity` enum('Y','N') DEFAULT NULL,
  `food_habit` enum('Daily','Nondaily') DEFAULT NULL,
  `hbp` enum('Y','N') DEFAULT NULL,
  `blood_sugar` enum('Y','N') DEFAULT NULL,
  `family_history` enum('No','Yes-second-relation','Yes-first-relation') DEFAULT NULL,
  `points` int(2) NOT NULL,
  `risk` enum('1','2','3','4','5') DEFAULT NULL,
  `date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


